import React, {useState} from 'react'
  
export const Pdf = () => {
    const [embedUrl]='https://drive.google.com/file/d/1UaCdUdUJPO_NW2Qvj2iJUgRQkV2V5aTZ/preview'
    return(
        <div className="Container">
            <h1>seso</h1>
            <iframe src={embedUrl} width="640" height="480" allow="autoplay"></iframe>
        </div>
    )
}

export default Pdf;
